function checkScrollDirection(event) {
	var mountain = document.getElementById("mountain");
  var trakker = document.getElementById("trakker");
  //const bg = document.getElementById("bg");
  var bg = document.querySelector("#bg");
  var trakking = document.querySelector("#trakking");
  

  if (checkScrollDirectionIsUp(event)) {
    set_translate(bg, 0, 0);
    set_translate(trakking, 0, 0);
    set_translate(mountain, 0, 0);
  } else {
    set_translate(bg, 10, 10);
    set_translate(trakking, 10, -5);
	set_translate(mountain, 0, 0);
  }
}

function checkScrollDirectionIsUp(event) {
  if (event.wheelDelta) {
    return event.wheelDelta > 0;
  }
  return event.deltaY < 0;
}


function set_translate(e, pix, pixY) {
	e.style["-webkit-transform"] = "translateX("+ pix +"vh) translateY("+ pixY +"vh)";
  e.style["-moz-transform"] = "translateX(" + pix +"vh) translateY(" + pixY +"vh)";
  e.style["-ms-transform"] = "translateX(" + pix + "vh) translateY(" + pixY + "vh)";
  e.style["-o-transform"] = "translateX(" + pix  + "vh) translateY(" + pixY  + "vh)";
  e.style["transform"] = "translateX(" + pix + "vh) translateY(" + pixY + "vh)";
}
  
function set_align(e) {
	//e.style["margin-left"] = (document.body.clientWidth/2)+"px";
  e.style["margin-left"] = "auto";
  e.style["margin-right"] = "auto";
}
  
function set_size(e) {
  e.style["width"] = (document.body.clientWidth)+"px";
  e.style["height"] = (document.body.clientHeight)+"px";
	//e.style["background-size"] = 100+"%"+ ""+100+"%" ;
}

